import React from "react";
import "./OurService2.css";

function OurService2() {
  return (
    <div>
      <div className="sec7-head">Our Services</div>
      <div className="sec7-head2">
        A UI UX company that is transforming and scaling <br />
        businesses successfully through its services
      </div>
    </div>
  );
}

export default OurService2;
